package com.ganjx.cinema.vo.mtime.list;

import java.io.Serializable;

public class MList implements Serializable{	private static final long serialVersionUID = 463362866L;	public long sortid;	public String bid;	public long cid;	public String logo;	public String cname;	public String dsname;	public String sbid;	public long did;	public String sname;	public String sid;	public String feature;	public String address;	public boolean isticket;	public String showtimepage;	public String lowestprice;	public MList() {}
	public MList(long sortid, String bid, long cid, String logo, String cname, String dsname, String sbid, long did, String sname, String sid, String feature, String address, boolean isticket, String showtimepage, String lowestprice){
		super();		this.sortid = sortid;		this.bid = bid;		this.cid = cid;		this.logo = logo;		this.cname = cname;		this.dsname = dsname;		this.sbid = sbid;		this.did = did;		this.sname = sname;		this.sid = sid;		this.feature = feature;		this.address = address;		this.isticket = isticket;		this.showtimepage = showtimepage;		this.lowestprice = lowestprice;
	}

		public String toString() {
		return "List [sortid = " + sortid + ", bid = " + bid + ", cid = " + cid + ", logo = " + logo + ", cname = " + cname + ", dsname = " + dsname + ", sbid = " + sbid + ", did = " + did + ", sname = " + sname + ", sid = " + sid + ", feature = " + feature + ", address = " + address + ", isticket = " + isticket + ", showtimepage = " + showtimepage + ", lowestprice = " + lowestprice + "]";	}
}